import Layout from './../components/Layout';
import MyTerminal from './../components/MyTerminal';

export default function Index() {
    return (
		<Layout>
			<div>
				<MyTerminal />
				<p>This is the home page</p>
			</div>
			<style jsx>{`
		.blCJWW{
			height: 100% !important;
			min-height: 80% !important;
		}
      		`}</style>
		</Layout>
    );
  }
